            <ProjectCard name="Farmers Retreat Website" photoUrl="" description="Hi"/>
            <ProjectCard name="NYU Holodeck: High Speed Research Network" photoUrl="" description="Hi"/>
            <ProjectCard name="NYU Holodeck: High Speed Research Network" photoUrl="" description="Hi"/>
       </div>
    );
};

const styles = {
    container: {
        paddingLeft: '100px',
        paddingRight: '100px',
        display: 'flex', /* Enable flexbox */
        flexDirection: 'column', /* Stack items vertically */
        gap: '30px', /* Space between cards */

    }
}

export default Projects;
